import { useState } from "react";
import { useEffect } from "react";


const ShowMetrics = prop => {
    const [transactionMetrics, setTransactionMetrics] = useState([]);
    useEffect(() => {
        const handlerFetchMetrics = async () => {
            // fetch metrics
            const getFetchMetrics = await fetch('http://localhost:4000/v1/product/transaction/sells/metrics', {
                headers: {
                    'Content-Type': 'application/json',
                    'Access-Control-Allow-Origin': '*'
                }
            });
            const resFetchMetrics = await getFetchMetrics.json();
            setTransactionMetrics(resFetchMetrics);
        }
        handlerFetchMetrics();
    }, [prop]);
    return(
        <>
        <article className="content-metrics-header-mybusiness col-12 col-sm-12 col-lg-12 col-xl-12">
            <ul>
                <li>
                    Ventas: <span className='text-primary'>{transactionMetrics.success}</span>
                </li>
                <li>
                    Registros: <span className='text-secondary'>4.500</span>
                </li>
                <li>
                    Consultas: <span className='text-primary'>134.000</span>
                </li>
                <li>
                    Referidos: <span className='text-secondary'>15.000</span>
                </li>
                <li>
                    Productos y servicios: <span className='text-primary'>545.000</span>
                </li>
                <li>
                    Influencers: <span className='text-secondary'>250</span>
                </li>
            </ul>    
        </article>
        </>
    )
}

export default ShowMetrics;
